","keccak256":"0x28911e614500ae7c607a432a709d35da25f3bc5ddc8bd12b278b66358070c0ea","license":"MIT"},"contracts/core/AdminStorage.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity >=0.7.4;

import 'hardhat/console.sol';

contract AdminStorage {
    address public admin;
    address public pendingAdmin;

    event NewPendingAdmin(address oldPendingAdmin, address newPendingAdmin);

    event NewAdmin(address oldAdmin, address newAdmin);

    constructor(address _admin) {
        admin = _admin;
        emit NewAdmin(address(0), admin);
    }

    modifier onlyAdmin() {
        require(isAdmin(msg.sender), 'Not admin');
        _;
    }

    modifier onlyPendingAdmin() {
        require(isPendingAdmin(msg.sender), 'Not pending admin');
        _;
    }

    function setPendingAdmin(address admin_) external onlyAdmin {
        require(admin_ != address(0), "new admin shouldn't be empty");
        require(admin_ != admin, 'new admin is the save with old admin');
        address oldPendingAdmin = pendingAdmin;
        pendingAdmin = admin_;
        emit NewPendingAdmin(oldPendingAdmin, pendingAdmin);
    }

    function acceptAdmin() external onlyPendingAdmin {
        address oldAdmin = admin;
        admin = pendingAdmin;
        emit NewAdmin(oldAdmin, admin);
        address oldPendingAdmin = pendingAdmin;
        pendingAdmin = address(0);
        emit NewPendingAdmin(oldPendingAdmin, pendingAdmin);
    }

    function isAdmin(address account) public view returns (bool) {
        return account == admin;
    }

    function isPendingAdmin(address account) public view returns (bool) {
        return account == pendingAdmin;
    }
}
","keccak256":"0x2fa677d50e9ce23aae342353aad3779ed0350410206079c1abba2b584d1de275","license":"MIT"},"contracts/core/AdminableInit.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity >=0.7.4;

import '@openzeppelin/contracts/proxy/Initializable.sol';
import './AdminStorage.sol';

contract AdminableInit is Initializable {
    AdminStorage adminStorage;

    constructor() {}

    function initializeAdmin(address _store) internal {
        require(_store != address(0), "new storage shouldn't be empty");
        adminStorage = AdminStorage(_store);
    }

    modifier onlyAdmin() {
        require(adminStorage.isAdmin(msg.sender), 'Not admin');
        _;
    }

    function isAdmin(address from) external view returns (bool) {
        return adminStorage.isAdmin(from);
    }

    function admin() external view returns (address) {
        return adminStorage.admin();
    }

    function getAdminStorage() public view returns (AdminStorage) {
        return adminStorage;
    }
}
","keccak256":"0xde3225e98a901dd43c88293c11bf6be78df627f9281ac8af8f12ee0deb793651","license":"MIT"},"contracts/core/SwapStorage.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity >=0.7.4;
pragma experimental ABIEncoderV2;

import './AdminableInit.sol';
import '../interface/ISwapStorage.sol';
import '../interface/IUniswapV2Router02.sol';
import '@openzeppelin/contracts/math/SafeMath.sol';
import '@openzeppelin/contracts/token/ERC20/IERC20.sol';

contract SwapStorage is AdminableInit, ISwapStorage {
    using SafeMath for uint256;

    mapping(address => mapping(address => PathItem)) pathes;

    constructor() {}

    function initialize(address _store) public initializer {
        AdminableInit.initializeAdmin(_store);
    }

    function setPath(
        address _from,
        address _to,
        address[] calldata _path,
        address[] calldata _pair
    ) external onlyAdmin {
        require(_path.length >= 2, 'illegal path length');
        require(_path.length == _pair.length + 1, 'illegal pair length');
        require(_from == _path[0], 'The first token of the Uniswap route must be the from token');
        require(_to == _path[_path.length - 1], 'The last token of the Uniswap route must be the to token');
        PathItem memory item;
        item.path = _path;
        item.pair = _pair;
        pathes[_from][_to] = item;
    }

    function delPath(address _from, address _to) external onlyAdmin {
        delete pathes[_from][_to];
    }

    function pathFor(address _from, address _to) external view override returns (PathItem memory) {
        return pathes[_from][_to];
    }
}
